import React, { Component } from 'react';

class App extends Component{
    constructor(){
        super();
        this.state = {
            number: 0
        }
    }


    
    render(){
        return(
            <div class="container">
                <h1>{this.state.number}</h1>
                <button class="btn btn-primary">Click me!</button>
            </div>
        )
    }
}

export default App
